    false,nt"url": null,nt"notes": "These data depict ecologically important
    areas that were developed through a collaborative process involving Oceana; groundfish
    trawl fishermen, organized by the Fishermen's Marketing Association; the Fisheries
    Heritage Group, bringing together harbor managers, the Nature Conservancy, Environmental
    Defense, the Center for Future Oceans, and fisheries representatives; Council Advisory
    Bodies; and West Coast states. These areas were designated by the Pacific Fishery
    Management Council on June 15, 2005 as part of the Preferred Alternative for the
    Groundfish Essential Fish Habitat (EFH), Final Environmental Impact Statement (FEIS).
    In order to minimize adverse impacts to EFH, these areas are proposed to be closed
